import { Fragment } from "react";
import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals.js";

function App() {
  return (
    <Fragment>
      <Header title="React Meals">Let's get started!</Header>
      <main>
        <Meals />
      </main>
    </Fragment>
  );
}

export default App;
